import React from "react";
import { useForm } from "react-hook-form";

const RegLog = () => {
  const {
    register,
    handleSubmit,
    watch,
    formState: { errors },
  } = useForm();
  return (
    <>
      <div className="container">
        <h1>RGISTER FORM</h1>
        <button className="btn btn-success"></button>
      </div>
    </>
  );
};

export default RegLog;
